passwordremindertext:
Mẹde (sọn adlẹsi IP tọn $1) basi obiọ họ̀nhungan yọyọ de tọn na {{SITENAME}} ($4). Họ̀nhungan whenu gli tọn na zinzántọ "$2" ko yin awuwiwlena bo ko yin didoai do "$3". E yindọ lẹndai towe niyẹn, e na biọ dọ a ni hùn adà towe bo de họ̀nhungan yọyọ de todin. 
Họ̀nhungan whenu gli tọn towe na dohó to  {{PLURAL:$5|azán dopo gblamẹ|azán 5 gblamẹ}}

E yindọ mẹdevo wẹ basi obiọ ehe, kavi a ko flin hokún họ̀nhungan tọn towe, bo ma ka sọ jlo nado diọ ẹ ba, a sọgan dovọ́na wẹndomẹ ehe bo zindonukọ̀n po họ̀nhungan towe hoho lọ po.

